    'about.AboutBrand': 'O serwisie OLX',
    'about.AboutText1': 'OLX jest najwi\u0119ksz\u0105 na \u015Bwiecie platform\u0105 og\u0142oszeniow\u0105 przeznaczon\u0105 g\u0142\xF3wnie na rynki wschodz\u0105ce. Serwis jest dost\u0119pny zar\xF3wno na urz\u0105dzeniach przeno\u015Bnych jak i online.',
    'about.AboutText2': 'OLX dzia\u0142a globalnie i jest obecny w ponad 40 krajach',
    'about.about_Body': '<p>OLX to nowa generacja darmowych og\u0142osze\u0144 internetowych.<br /><br />OLX oferuje proste rozwi\u0105zanie k\u0142opot\xF3w zwi\u0105zanych ze sprzeda\u017C\u0105, kupnem, handlem, organizacj\u0105 i nawi\u0105zywanie kontakt\xF3w, gdziekolwiek nas potrzebujesz.<br /><br />W OLX mo\u017Cesz:<br /><ul><li>\u0142atwo projektowa\u0107 w\u0142asne og\u0142oszenia ze zdj\u0119ciami</li><li>zarz\u0105dza\u0107 zakupami, sprzeda\u017C\u0105 i aktywno\u015Bci\u0105 spo\u0142eczno\u015Bciow\u0105 poprzez My OLX</li><li>wy\u015Bwietla\u0107 og\u0142oszenia na portalach spo\u0142eczno\u015Bciowych, takich jak Facebook, Myspace, ...</li><li>korzysta\u0107 z serwisu za po\u015Brednictwem telefonu kom\xF3rkowego</li><li>wy\u015Bwietla\u0107 nasz\u0105 stron\u0119 w swoim j\u0119zyku lokalnym.</li></ul><br />OLX dzia\u0142a w ponad <<QTY_COUNTRIES>> krajach, w <<QTY_LANGUAGES>> j\u0119zykach. Serwis nale\u017Cy do prywatnej formy za\u0142o\u017Conej w marcu 2006 roku.</p>',
